import Post from "../Post/Post";
import "./Posts.scss";

const Posts = () => {
  //TEMPORARY
const Posts = [
    {
      id: 1,
      name: "Vina Ruruth",
      userId: 1,
      profilePic:
        "../../assets/343409541_935615894306699_180342932049969498_n.jpg",
      desc: "Travelling the world! This is awesome!",
      img: "https://images.pexels.com/photos/2422461/pexels-photo-2422461.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1",
    },
    {
      id: 2,
      name: "Gina Cole",
      userId: 2,
      profilePic:
        "https://images.pexels.com/photos/788567/pexels-photo-788567.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1",
      desc: "Hello dear friends,, hope u have a nice day godbless",
    },
    {
      id: 3,
      name: "Vina Ruruth",
      userId: 3,
      profilePic:
        "https://images.pexels.com/photos/1036623/pexels-photo-1036623.jpeg?auto=compress&cs=tinysrgb&w=1600",
      desc: "This new boba place is awesome!",
      img: "https://images.pexels.com/photos/12187693/pexels-photo-12187693.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1",
    },
    {
      id: 4,
      name: "Vina Ruruth",
      userId: 4,
      profilePic:
        "https://upload.wikimedia.org/wikipedia/commons/2/2c/Default_pfp.svg",
      desc: "Lorem ipsum dolor sit amet consectetur adipisicing elit",
      // img: "https://images.pexels.com/photos/4881619/pexels-photo-4881619.jpeg?auto=compress&cs=tinysrgb&w=1600",
    },
  ];

  return <div className="Posts">
    {Posts.map(post=>(
      <Post post={post} key={post.id}/>
    ))}
  </div>;
};

export default Posts;
